import React from "react";

const Home = () => {
  return (
    <>
      <section className="" id="header">
        <div className="container-fluid nav_bg">
          <div className="row">
            <div className="col-10 mx-auto">
              
            </div>
          </div>
        </div>
      </section>
    </>
  );
};

export default Home;
